  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Sand Lake
  WMD outlines Refuge accomplishments during the 1968 calendar year. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover conditions during the year. Wildlife- including migratory birds,
  upland game birds, big game animals, furbearers, predators, rodents, mammals, raptors,
  and fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, collections and receipts, and vegetation control.
  Resource management is outlined; topics include grazing and fur harvesting. The
  public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, and hunting. Items of interest, N-R forms, and photographs
  are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
